import React, { useEffect } from 'react'


function Stories() {
    let API = "https://hn.algolia.com/api/v1/search?query=react";


    const FetchAPIData = async (url) => {
       try{
        const res = await fetch(url);
        const data = res.json();
       } catch (err){
        console.log(err)
       }
    }

    useEffect(() => {
        FetchAPIData(API)
            
    },[API]);
  return (
    <>
     <h2>My News post</h2>
    </>
  )
}

export default Stories
